import React ,{useState} from "react";
import {createpokemon} from "../actions/actions"



function Createpokemons(){
    const [input,setInput] = useState({
            name:'',
            Health:'',
            strength:'',
            defending:'',
            velocity:'',
            height:'',
            weight:''
    })
    function onChange(e) {
        console.log(e)
        setInput({
            ...input,
            [e.target.name]:e.target.value
        })
    }

    return(
        <div className='create'>
        name:<input type="text" className='name' onChange={onChange}/>
        Health:<input type="text" className='health'onChange={onChange}/>
        Strength:<input type="text" className='strength'onChange={onChange}/>
        Defending:<input type="text" className='defending'onChange={onChange}/>
        velocity:<input type="text" className='velocity'onChange={onChange}/>
        Height:<input type="text" className='height' onChange={onChange}/>
        Weight:<input type="text" className='weight' onChange={onChange}/>
        <input type="submit" value={input} onClick={createpokemon} />

        </div>
    )
}


export default Createpokemons
